import React from 'react';
import {Navegador} from './navegador/';
import {TituloPrincipal} from './tituloprincipal/';
import {TablaTransacciones} from './tablatransacciones/';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="tituloHeader">Grupo Fernandez</div>
        <div className="navegadorHeader">
          <Navegador />
        </div>
      </header>
      <TituloPrincipal />
      <TablaTransacciones />
    </div>
  );
}

export default App;
